CREATE TABLE "URP_STU_CLASS"(
	"STU_NO" CHAR(8) NOT NULL, 
	"CLASS_NO" CHAR(8) NOT NULL, 
	"INPUTTIME" DATE DEFAULT ((Sysdate)) NOT NULL, 
	CONSTRAINT "PK_URP_STU_CLASS" PRIMARY KEY ("STU_NO", "CLASS_NO"), 
	CONSTRAINT "FK_URP_STU_CLASS_CLASS_NO" FOREIGN KEY ("CLASS_NO") REFERENCES "URP_CLASS" ("CLASS_NO"), 
	CONSTRAINT "FK_URP_STU_CLASS_STU_NO" FOREIGN KEY ("STU_NO") REFERENCES "URP_STUDENT" ("STU_NO")
);

